import Link from 'next/link'
import Router from 'next/router'
import { Button } from 'antd'
import "../test.css"
export default () => {

    function gotoTestB() {
        Router.push({
            pathname: '/test/b',
            query: {
                id: 2
            }
        })
    }
    return (
        <>
            <Link href="/a?id=1" as="/a/1">
                <Button type="primary">Welcome to next.js</Button>
            </Link>
            <Button type="warning" onClick={gotoTestB}>test B</Button>
        </>
    )
}
